import React from "react";

export default function NavPages({
	totalPages,
	handleChangePage,
	currentPage,
}) {
	let row = [];
	const navRange = Math.floor(currentPage / 4);
	console.log("navRange", navRange);
	console.log("currentPage", currentPage);
	console.log("totalPages", totalPages);
	if (navRange < 1) {
		row = [];
		for (let i = 1; i <= 3; i++) {
			if (i === currentPage) {
				row.push(
					<button
						className="btn btn-success"
						onClick={() => handleChangePage(i)}
					>
						{i}
					</button>
				);
			} else {
				row.push(<button onClick={() => handleChangePage(i)}>{i}</button>);
			}
		}
		row.push(
			<button onClick={() => handleChangePage(currentPage + 1)}>&#62;</button>
		);
		row.push(
			<button onClick={() => handleChangePage(totalPages)}>&#187;</button>
		);
	} else {
		row = [];
		row.push(<button onClick={() => handleChangePage(1)}>&#171;</button>);
		row.push(
			<button onClick={() => handleChangePage(currentPage - 1)}>&#60;</button>
		);
		for (let i = navRange * 4; i < (navRange + 1) * 4; i++) {
			if (i <= totalPages) {
				if (i === currentPage) {
					row.push(
						<button
							className="btn btn-success"
							onClick={() => handleChangePage(i)}
						>
							{i}
						</button>
					);
				} else {
					row.push(<button onClick={() => handleChangePage(i)}>{i}</button>);
				}
			}
		}
		if (totalPages > (navRange + 1) * 4) {
			row.push(
				<button onClick={() => handleChangePage(currentPage + 1)}>&#62;</button>
			);
			row.push(
				<button onClick={() => handleChangePage(totalPages)}>&#187;</button>
			);
		}
	}
	return <div>{row}</div>;
}
